    def PasswordList(self):
        import random
        string = "ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz"
        number = "1234567890"
        ghavi = string+number
        tol = self.lineEditTol.text()
        numberPass = self.lineEdittedad.text()
        for i in range(int(numberPass)):
            password = "".join(random.sample(ghavi, int(tol)))
            print(password)


